import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';

function Clients() {

    const navigate = useNavigate();
    const [clients, setClients] = useState([]);

    useEffect(() => {
        getClients();
    }, []);


    const getClients = async() => {
        console.log("333 at getClients function");
        const data = await fetch('http://localhost:3090/clients');
        const clientss = await data.json();
        console.log(clientss);
        setClients([...clientss]);
    };

    const addClient = () => {
        navigate('add');
    };

    const clientDetails = (client) => {
        console.log(client);
        navigate(`${client.id}`, { state: client });
    };

    return ( <
        div >
        <
        h1 > Clients - The members of the health fund < /h1> <
        button onClick = { addClient } > add client < /button> <
        div className = 'grid' > {
            clients.map(client => {
                return (
                    // Link to={`/health-funds.co.il/clients/client#${client.id}`}
                    <
                    div className = 'container'
                    key = { client.id }
                    onClick = {
                        () => { clientDetails(client) } } >
                    <
                    p > { client.id } { client.firstName } { client.lastName } < /p> <
                    /div>
                );
            })
        } < /div> <
        /div>
    )
};

export default Clients;
